tables.table_schema:
CREATE TABLE land_types (
    land_type_id SERIAL PRIMARY KEY,
    land_type_name TEXT NOT NULL,
    land_classification TEXT NOT NULL
);

CREATE TABLE LandTypes (
    land_id UUID PRIMARY KEY,
    land_name STRING,
    land_type STRING,
    land_area FLOAT
);

CREATE TABLE LandClassifications (
    classification_id UUID PRIMARY KEY,
    classification_name STRING,
    classification_type STRING
);

CREATE TABLE LandRecords (
    record_id UUID PRIMARY KEY,
    record_date TIMESTAMP,
    land_id UUID,
    classification_id UUID
);

CREATE TABLE LandTypes (
    id INT PRIMARY KEY,
    land_type VARCHAR(50) NOT NULL,
    description TEXT
);

CREATE TABLE LandClassifications (
    id INT PRIMARY KEY,
    classification_name VARCHAR(50) NOT NULL,
    classification_code VARCHAR(10) UNIQUE,
    description TEXT
);

CREATE TABLE SpatialData (
    id INT PRIMARY KEY,
    location_point GEOMETRY NOT NULL,
    data_value FLOAT NOT NULL,
    data_type VARCHAR(50)
);

CREATE TABLE LandMapping (
    id INT PRIMARY KEY,
    land_type_id INT REFERENCES LandTypes(id),
    classification_id INT REFERENCES LandClassifications(id),
    spatial_data_id INT REFERENCES SpatialData(id)
);

CREATE TABLE land_types (
    id INT PRIMARY KEY,
    land_type_name VARCHAR(255) NOT NULL,
    land_type_description TEXT
);

CREATE TABLE classifications (
    id INT PRIMARY KEY,
    classification_name VARCHAR(255) NOT NULL,
    classification_description TEXT
);

CREATE TABLE visualization (
    id INT PRIMARY KEY,
    visualization_name VARCHAR(255) NOT NULL,
    visualization_type VARCHAR(50) NOT NULL,
    visualization_data JSONB
);

CREATE TABLE spatial_data (
    id INT PRIMARY KEY,
    data_name VARCHAR(255) NOT NULL,
    data_type VARCHAR(50) NOT NULL,
    spatial_data JSONB
);
